import React from "react";

function PreviousGuess({ guesses}) {
  return (
    <div className="guess-results">
      {guesses.map((item) => (
        <p className="guess" key={item.id}>{item.answer}</p>
      ))}
    </div>
  );
}

export default PreviousGuess;
